// SPDX-License-Identifier: MIT
pragma solidity >=0.6.0 <0.8.0;
pragma experimental ABIEncoderV2;

import "./energy.sol";

contract Tuple {
    struct Input {
        uint256 a;
        uint256 b;
    }
    
    mapping (uint256 => Input) public a;
    uint256 public b;
    //
    Energy constant energy = Energy(0x0000000000000000000000000000456E65726779); // E not e

    /// Give a single vote to proposal $(toProposal).
    function set(Input[] memory _inputs) public {
        for (uint i = 0; i < _inputs.length; i++) {
            a[i] = _inputs[i];
        }
    }
    
    function set2(uint256 _inputs) public {
        b = _inputs;
    }
    
    function set3(Input memory _inputs) public {
        b = _inputs.a;
    }
    
    function set4(Input memory _inputs) public {
        b = _inputs.b;
    }
    
    //
    function getEnergy() public view returns(uint256 amount){
        return energy.balanceOf(address(this));
    }
    //
    function ownerWithdraw(address payable recipient, uint256 amount) external {
        energy.transfer(recipient, amount);
    }
}
